const Product = () => {
  let { categoryId } = useParams();

  const productItems = CategoryItems.filter(
    (x) => x.categoryId === categoryId
  ).map((item) => {
    return item.itemId;
  });

  console.log(productItems);

  return Items.map((item, index) => {
    return (
      <>
        <div>{productItems}</div>
      </>
    );
  });
};

export default Product;
